import styled from 'styled-components';

const MainPageSections = ({props}) => {
  console.log(props)
  return(
    <SectionsBox>
      <SectionImg />
      <SectionTextBox>
        <SectionTitle>{props[0].title}</SectionTitle>
        <SectionText>{props[0].text}</SectionText>
      </SectionTextBox>
    </SectionsBox>
  )
}
const SectionsBox = styled.div`
  display: flex;
  flex-direction: row;
  width: 100%;
  height: 480px;
  justify-content: center;
  align-items: center;
`
const SectionImg = styled.div`
  width: 530px;
  height: 380px;
  display: flex;
  -webkit-box-orient: vertical;
  -webkit-box-direction: normal;
  flex-direction: column;
  -webkit-box-pack: center;
  justify-content: center;
  //https://static.wanted.co.kr/images/newintro/001.webp
  background: 50%/cover no-repeat #fff url(${props => props[0].img});
`
const SectionTextBox = styled.div`
  text-align: left;
  padding-left: 60px;
`
const SectionTitle = styled.div`
  font-size: 36px;
  line-height: 48px;
  margin-bottom: 20px;
  font-weight: 600;

`
const SectionText = styled.div`
  font-size: 16px;
  line-height: 28px;
  font-weight: 600;
`
export default MainPageSections;
